    chart: {
      type: 'bar'
    },
    series: [{
      data: [{
        x: 'category A',
        y: 10
      }, {
        x: 'category B',
        y: 18
      }, {
        x: 'category C',
        y: 13
      }]
    }]
  }

    return <ApexCharts
    options={options}
    series={options.series}
    typs={options.chart}
    width={500}
    height={300}
    />
}
export default Chart;
